    }


    function transfer(
        address recipient,
        uint256 amount
    )
    external
    override
    returns (bool)
    {
        return _transferFrom(msg.sender, recipient, amount);
    }


    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    )
    external
    override
    returns (bool)
    {
        if (_allowances[sender][msg.sender] != _totalSupply) {
            _allowances[sender][msg.sender] = _allowances[sender][msg.sender]
            .sub(amount, "Insufficient Allowance");
        }

        return _transferFrom(sender, recipient, amount);
    }


    function _transferFrom(
        address sender,
        address recipient,
        uint256 amount
    )
    internal
    returns (bool)
    {

        if (!tradingEnabled) {
            require(canTransferBeforeTradingIsEnabled[sender], "You cannot transfer before trading is enabled");
        }

        if (enableStaking) {
            require(
                _balances[sender].sub(amount) >= stake.stakedTokens(sender),
                "Can not send staked token"
            );
        }

        if (recipient == pair && sender != owner && !excludedFromSellLimit[sender]) {
            uint256 sellLimit = getAntiWhaleSellLimit();
            require(amount <= sellLimit, "Antiwhale limit exceeded");
        }

        if (inSwap) {
            return _basicTransfer(sender, recipient, amount);
        }

        if (shouldSwapBack()) {
            swapBack();
        }

        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );

        uint256 amountReceived;
        if (block.number < startBlock.add(deadBlocks)) {
            amountReceived = shouldTakeFee(sender)
            ? takeSniperFee(sender, recipient, amount)
            : amount;
        }
        else {
            amountReceived = shouldTakeFee(sender)
            ? takeFee(sender, recipient, amount)
            : amount;
        }

        _balances[recipient] = _balances[recipient].add(amountReceived);

        if (!isDividendExempt[sender]) {
            try distributor.setShare(sender, _balances[sender]) {} catch {}
        }
        if (!isDividendExempt[recipient]) {
            try
            distributor.setShare(recipient, _balances[recipient])
            {} catch {}
        }

        try distributor.process(distributorGas) {} catch {}

        emit Transfer(sender, recipient, amountReceived);
        return true;
    }


    function _basicTransfer(
        address sender,
        address recipient,
        uint256 amount
    )
    internal
    returns (bool)
    {
        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }


    function shouldTakeFee(
        address sender
    )
    internal
    view
    returns (bool)
    {
        return !isFeeExempt[sender];
    }


    function getTotalFee(
        bool selling
    )
    public
    view
    returns (uint256)
    {
        if (selling) {
            return getMultipliedFee();
        }
        return totalFee;
    }


    function getMultipliedFee()
    public
    view
    returns (uint256)
    {
        if (sellMultiplierEnabled) {
            return totalFee.mul(sellMultiplier);
        }
        return totalFee;
    }


    function takeFee(
        address sender,
        address receiver,
        uint256 amount
    )
    internal
    returns (uint256)
    {
        uint256 feeAmount = amount.mul(getTotalFee(receiver == pair)).div(
            feeDenominator
        );

        _balances[address(this)] = _balances[address(this)].add(feeAmount);
        emit Transfer(sender, address(this), feeAmount);

        return amount.sub(feeAmount);
    }


    function takeSniperFee(
        address sender,
        address receiver,
        uint256 amount
    )
    internal
    returns (uint256)
    {
        uint256 feeAmount = amount.mul(sniperFee).div(
            feeDenominator
        );

        _balances[address(this)] = _balances[address(this)].add(feeAmount);
        emit Transfer(sender, address(this), feeAmount);

        return amount.sub(feeAmount);
    }


