    external
    authorized
    {
        distributor.setDistributionCriteria(_minPeriod, _minDistribution);
    }


    function setDistributorSettings(
        uint256 gas
    )
    external
    authorized
    {
        require(gas < 750000, "Gas must be lower than 750000");
        distributorGas = gas;
    }


    function setAntiWhaleSellLimitDenominator(
        uint256 newDenominator
    )
    external
    authorized
    {
        require(
            newDenominator <= 100000,
            "amount must be greater than 0.001% of circulating supply supply"
        );
        antiWhaleSellLimitDenominator = newDenominator;
    }


    function getCirculatingSupply()
    public
    view
    returns (uint256)
    {
        return _totalSupply.sub(balanceOf(DEAD)).sub(balanceOf(ZERO));
    }

    function getAntiWhaleSellLimit()
    public
    view
    returns (uint256)
    {
        return getCirculatingSupply()/antiWhaleSellLimitDenominator;
    }


    // Determines what percent of market cap is backed
    function getLiquidityBacking(
        uint256 accuracy
    )
    public
    view
    returns (uint256)
    {
        return accuracy.mul(balanceOf(pair).mul(2)).div(getCirculatingSupply());
    }


    // Determines if target liquidity is met
    function isOverLiquified(
        uint256 target,
        uint256 accuracy
    )
    public
    view
    returns (bool)
    {
        return getLiquidityBacking(accuracy) > target;
    }


    function setSellMultiplier(
        bool _enabled,
        uint256 _multiplier
    )
    external
    authorized
    {
        require(_multiplier <= 2, "Sell Multiplier Cannot be more than 2x");
        sellMultiplierEnabled = _enabled;
        sellMultiplier = _multiplier;
    }
}
